Jūsų patogumui, programėlė yra pasiekiama lietuvių ir anglų kalbomis.

Pirmą kartą, kai prisijungsite naudodamiesi interneto banko prisijungimo priemonėmis, būsite paprašyti sugalvoti 4 skaitmenų PIN kodą, kuriuo galėsite greitai prisijungti prie programėlės. Taip pat prisijungimui galėsite naudoti piršto atspaudą.
